  <div className="card">
        <div className="top">
          <h2 className="name">Jim Carrey</h2>
          <img className="circle-img "
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSVl6f7CWwdVCgb_bEHUT9ZuoY8wz50EET_dw&usqp=CAU"
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p className="info">+123 456 789</p>
          <p className="info">j@carrey.com</p>
        </div>
      </div>
}


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>     

      <Card />

    </div>
  );
}

export default App;
